script: |
  super -f text -I q6493.spq | sort > q6493.out

inputs:
  - name: q6493.spq
    data: |
      SELECT 73 + - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE - - col1 * col2 BETWEEN ( + + col0 / + col0 ) AND ( ( - 72 ) + CAST ( 33 AS INTEGER ) - - col2 / 82 );
  - name: tab0

outputs:
  - name: q6493.out
    data: |
